import React from "react";
import Tags from "../Tags/Tags";
import styles from './Box.module.css';

const Box = ({ title, description, tags, subscriptions }) => {
  return (
    <div className="box">
      <div className="content">
        <div className="description">
          <h1>{title}</h1>
          <p>{description}</p>
        </div>
        <Tags values={tags} />
      </div>
      <div className="footer">
        <ul></ul>
      </div>
    </div>
  );
};

export default Box;
